/* eslint-disable jsx-a11y/anchor-is-valid */
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";
import { Layout, Row, Col } from "antd";
import "antd/dist/antd.css";
import LogoTiki from "../logoTiki.png";
import "./Navbar.css";
import DropdownComponent from "./navbarComponents/Dropdown";
import SearchBar from "./navbarComponents/SearchBar";
import UserComponent from "./navbarComponents/User";
import Cart from "./navbarComponents/Cart";

const { Header, Content, Footer } = Layout;

export default function Navbar() {
  return (
    <div>
      <Router>
        <Header className="header-navbar">
          <Row>
            <Col flex="300px"></Col>
            <Col flex="70px">
              <div className="logo">
                <img src={LogoTiki} alt="logo tiki" width="50px" />
              </div>
            </Col>
            <Col flex="150px" className="dropdown-danhmuc">
              <DropdownComponent />
            </Col>
            <Col flex="auto" className="searchbar">
              <SearchBar />
            </Col>
            <Col flex="100px">
              <UserComponent />
            </Col>
            <Col flex="100px"></Col>
            <Col flex="300px"></Col>
          </Row>
        </Header>
        <Content style={{ padding: "0 50px" }}>
          <div className="site-layout-content">Content</div>
        </Content>
        <Footer style={{ textAlign: "center" }}>
          Ant Design Â©2018 Created by Ant UED
        </Footer>

        <Switch>
          <Route exact path="/dskhachhang"></Route>
          <Route exact path="/dsnhaban"></Route>
        </Switch>
      </Router>
    </div>
  );
}
